namespace RonSijm.FluidHumidifier.Factories.SES;

public class ConfigurationSetFactory(string resourceName = null, Action<Humidifier.SES.ConfigurationSet> factoryAction = null) : ResourceFactory<Humidifier.SES.ConfigurationSet>(resourceName)
{

    internal InnerConfigurationSetSendingOptionsFactory SendingOptionsFactory { get; set; }

    internal InnerConfigurationSetSuppressionOptionsFactory SuppressionOptionsFactory { get; set; }

    internal InnerConfigurationSetTrackingOptionsFactory TrackingOptionsFactory { get; set; }

    internal InnerConfigurationSetReputationOptionsFactory ReputationOptionsFactory { get; set; }

    internal InnerConfigurationSetVdmOptionsFactory VdmOptionsFactory { get; set; }

    internal InnerConfigurationSetDeliveryOptionsFactory DeliveryOptionsFactory { get; set; }

    protected override Humidifier.SES.ConfigurationSet Create()
    {
        var configurationSetResult = CreateConfigurationSet();
        factoryAction?.Invoke(configurationSetResult);

        return configurationSetResult;
    }

    private Humidifier.SES.ConfigurationSet CreateConfigurationSet()
    {
        var configurationSetResult = new Humidifier.SES.ConfigurationSet
        {
            GivenName = InputResourceName,
        };

        return configurationSetResult;
    }
    public override void CreateChildren(Humidifier.SES.ConfigurationSet result)
    {
        base.CreateChildren(result);

        result.SendingOptions ??= SendingOptionsFactory?.Build();
        result.SuppressionOptions ??= SuppressionOptionsFactory?.Build();
        result.TrackingOptions ??= TrackingOptionsFactory?.Build();
        result.ReputationOptions ??= ReputationOptionsFactory?.Build();
        result.VdmOptions ??= VdmOptionsFactory?.Build();
        result.DeliveryOptions ??= DeliveryOptionsFactory?.Build();
    }

} // End Of Class

